import React from 'react'
import './Footer.css'
import { FaFacebookF } from 'react-icons/fa';

const Footer = () => {
          return (
                    <div className='Footer'>
                    <div className="container">
                    <p><a href="https://www.facebook.com" target="_blank" rel="noopener"    class="fa fa-facebook-official" ></a>Facebook</p>
          <p><a href="https://www.instagram.com/" target="_blank" rel="noopener"   class="fa fa-instagram" ></a>Instagram</p>
          <p><a href="https://www.youtube.com/" target="_blank" rel="noopener"  class="fa fa-youtube-square" ></a>Youtube</p>
          <p><a href="https://www.twitter.com/" target="_blank" rel="noopener"   class="fa fa-twitter" ></a>Twitter</p>
                    </div>
                    </div>
          )
}

export default Footer
